           "INSERT INTO \"public\".\"ep_bank_master\" VALUES ('STATE BANK OF INDIA', 'SBIN0012407', 'PEDONG', 'SBI', 11, '2018-01-01 12:00:01', NULL, 1, 'N', NULL, NULL, NULL, NULL);",
        ];

        $rows = [];

        foreach ($lines as $line) {
            // Match both quoted strings and unquoted numbers (like 15, NULL)
            preg_match_all("/'([^']*)'|(\b[0-9]+\b)|NULL/i", $line, $matches);

            // Merge results into one flat array
            $vals = [];
            foreach ($matches[0] as $i => $m) {
                if (strtoupper($m) === 'NULL') {
                    $vals[] = null;
                } elseif ($matches[1][$i] !== '') {
                    $vals[] = $matches[1][$i];
                } elseif ($matches[2][$i] !== '') {
                    $vals[] = $matches[2][$i];
                }
            }

            if (count($vals) < 6) continue;

            $bankName = $vals[0] ?? '';
            $ifsc = $vals[1] ?? '';
            $branch = $vals[2] ?? '';
            $bankCodeRaw = $vals[3] ?? '';
            $accountDigits = isset($vals[4]) && is_numeric($vals[4]) ? (int)$vals[4] : 0;
            $createdAtRaw = $vals[5] ?? null;
            $status = (isset($vals[7]) && is_numeric($vals[7])) ? (int)$vals[7] : 1;

            $bankCode = substr($bankCodeRaw, 0, 4);
            $createdAt = Carbon::now();

            $rows[] = [
                'name' => $bankName,
                'branch_name' => $branch,
                'bank_code' => $bankCode,
                'ifsc_code' => $ifsc,
                'account_digits' => $accountDigits,
                'status' => $status,
                'created_at' => $createdAt,
                'updated_at' => $createdAt,
            ];
        }

        //  insert only once, after building all rows
        foreach (array_chunk($rows, 100) as $chunk) {
            DB::table('bs_bank_master')->insertOrIgnore($chunk);
        }
